import "../CSS/addtask.css";
import "../App.css";

export function AddTask() {
  const plus = require("../Images/sidebar-plus.png");
  return (
    <div className="addtask">
      <div className="addtaskflexContainer">
        <img src={plus} alt="addtask" />
        <br></br>
        <input></input>
      </div>
    </div>
  );
}
